import React, { useEffect, useState } from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper.min.css';
import SwiperCore, { Autoplay } from 'swiper';
import { isMobile } from '../../utils/device';
import { SwiperCloseButton } from '../../components/icon/Common';
import { GradientButton } from '~components/button/Button';

SwiperCore.use([Autoplay]);

export default function AdSwiper() {
  const [closeStatus, setCloseStatus] = useState(true);
  useEffect(() => {
    const popupSwiper = localStorage.getItem('ad-announcement');
    if (popupSwiper == '4') {
      setCloseStatus(true);
    } else {
      setCloseStatus(false);
    }
  }, []);
  const closePop = (e: any) => {
    localStorage.setItem('ad-announcement', '4');
    e.stopPropagation();
    setCloseStatus(true);
  };
  const is_mobile = isMobile();
  return (
    <>
      {closeStatus ? null : (
        <div>
          <Swiper
            spaceBetween={30}
            centeredSlides={true}
            autoHeight={false}
            autoplay={{
              delay: 10000,
              disableOnInteraction: false,
            }}
            loop={true}
          >
            <SwiperSlide>
              <div
                onClick={closePop}
                className="flex justify-end items-center absolute top-0 right-0 cursor-pointer z-10"
              >
                <SwiperCloseButton className="cursor-pointer"></SwiperCloseButton>
              </div>
              <div className="relative">
                <GradientButton
                  color="#fff"
                  borderRadius="6px"
                  onClick={() => {
                    window.open('/orderbook/perps');
                  }}
                  className={`absolute right-3.5 bottom-3.5 flex-shrink-0 px-2.5 h-7 text-center text-sm text-white focus:outline-none `}
                >
                  Trade now!
                </GradientButton>
                {is_mobile ? <Perp></Perp> : <Perp></Perp>}
              </div>
            </SwiperSlide>
            <SwiperSlide>
              <div
                onClick={closePop}
                className="flex justify-end items-center absolute top-0 right-0 cursor-pointer z-10"
              >
                <SwiperCloseButton className="cursor-pointer"></SwiperCloseButton>
              </div>
              <div className="relative">
                {is_mobile ? (
                  <StablePool></StablePool>
                ) : (
                  <StablePool></StablePool>
                )}
              </div>
            </SwiperSlide>
          </Swiper>
        </div>
      )}
    </>
  );
}
function Perp() {
  return (
    <img src="data:image/png;base64," />
  );
}
